import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    { title: "Car Insurance", price: 49.9, date: new Date(2020, 3, 22) },
    { title: "Gas", price: 10.9, date: new Date(2020, 3, 25) },
    { title: "Groceries", price: 40, date: new Date(2020, 4, 12) },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <p>This is also visible</p>
      <ExpenseItem />
    </div>
  );
}

export default App;
